INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0, 14714073, 1, "ふっ、ルカには日ごろ世話になってる\nからな！　生誕を祝うのは当然だ！\nちなみに私はローソクを立てたぞ！\n見ろ、完璧なバランスだろう！？", 0, 100911, 1, 11, 0.5, 10, 14714);
