INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0, 17814075, 1, "お誕生日、おめでとうッス！\nいやー、自分も早く誕生日を迎えて、\nジュンさんやトモね～ちゃんみたいな\n大人になりたいッス！", 0, 100511, 1, 11, 0.5, 10, 17814);
