INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0, 18814076, 1, "どう見たって誕生日ケーキだろう？\n心配しなくても、ナナカのお祝いだ。\n誕生日、おめでとう。", 0, 105611, 1, 11, 0.5, 10, 18814);
