INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0, 18814086, 1, "シグルドからも助言を得ている。\nナナカ生誕を祝すのにふさわしい、\n伝説級の品々を用意してあるぞ？\n限定魔法少女グッズの詰め合わせだ！", 0, 100911, 1, 11, 0.5, 10, 18814);
