INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0, 18814091, 1, "なんという僥倖ッ！\nみなさま、感謝いたしますぞ～！！\n期待に応えてこれからも、ぐうかわ\n魔法少女として邁進していくことを……", 0, 101311, 1, 11, 0.5, 10, 18814);
