INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0, 19814076, 1, "そんなわけあるか！！\n今日はニノンの誕生日なんだから、\nお祝いのケーキに決まっているだろう！", 0, 105311, 1, 11, 0.5, 10, 19814);
