INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0, 19814081, 1, "で、でも、お祝いのケーキによって\n痛い思いをさせられたら、より高い\nところから突き落とされたみたいで\n興奮しますね……じゅるり♪", 0, 104511, 1, 11, 0.5, 10, 19814);
