INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0, 26224063, 1, "わっ、これは随分と豪華なケーキだね。\nふむ……今日、ケーキを準備して誰かを\n待ち、そして後から呼ばれたのは……\nこの推理だと、わ、私のためかい？", 0, 101411, 1, 11, 0.5, 10, 26224);
