INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0, 31114086, 1, "ほ、欲しかったボードゲームが\nあるんですけど……いや、でも、\nあれって結構高かったっけ……？\nシノブさんにおねだりするのは……", 0, 102211, 1, 11, 0.5, 10, 31114);
