INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0, 38214070, 1, "マヒルさん、どうしました……？\nもしかして、誕生日ケーキに\n変なところでも……？", 0, 103811, 1, 11, 0.5, 10, 38214);
